import React from 'react';
import { MDBDataTable } from 'mdbreact';


const FindaGroup = () => 
{
  const data = { 
    columns: [
      {
        label: 'State',
        field: 'state',
        sort: 'asc',
        width: 150
      },
      {
        label: 'County',
        field: 'county',
        sort: 'asc',
        width: 270
      },
      {
        label: 'Contact Name',
        field: 'contactname',
        sort: 'asc',
        width: 200
      },
      {
        label: 'Contact Email',
        field: 'contactemail',
        sort: 'asc',
        width: 100
      }
    ],
    rows: [
      {
        state: 'MI',
        county: 'Wayne',
        contactname: 'Lisa Smith',
        contactemail: 'lsmith@gmail.com'
      },
      {
        state: 'MI',
        county: 'Lenawee',
        contactname: 'Mary Shaw',
        contactemail: 'maryshawhome@gmail.com'
      },
      {
        state: 'MI',
        county: 'Oakland',
        contactname: 'Mercedes Gray',
        contactemail: 'mgray123@gmail.com'
      }
    ]
  };

  return (
    <MDBDataTable
      striped
      bordered
      small
      data={data}
    />
  );
}

export default FindaGroup;
